using HAN_ASD_ADP.Implementations;
using HAN_ASD_ADP.Tests.TestClasses;
using Xunit;

namespace HAN_ASD_ADP.Tests.Implementations;

public class DynamicArrayPigsTests
{
    [Fact]
    public void Pig_100PigsAdd_Test()
    {
        // Arrange
        var listOfPigs = FillListOfPigs();

        // Assert
        Assert.Equal(100, listOfPigs.Count);
    }

    [Theory]
    [InlineData(100, true)]
    [InlineData(50, false)]
    [InlineData(1, false)]
    public void Pig_Get_Test(int index, bool expected)
    {
        // Arrange
        var listOfPigs = FillListOfPigs();
        Pig pig100 = new Pig("ABC123", new int[] { 1 });
        listOfPigs.Add(pig100);

        var searchPigByIndex = listOfPigs.Get(index);
        var result = pig100.Equals(searchPigByIndex);

        // Assert
        Assert.Equal(expected, result);
    }

    [Fact]
    public void Pig_Set_Test()
    {
        // Arrange
        var listOfPigs = FillListOfPigs();
        Pig pig = new Pig("ABC123", new int[] { 2 });
        listOfPigs.Set(0, pig);

        var searchPigByIndex = listOfPigs.Get(0);

        // Assert
        Assert.True(pig.Equals(searchPigByIndex));
    }

    [Fact]
    public void Pig_RemoveAt_Test()
    {
        // Arrange
        var listOfPigs = FillListOfPigs();
        var startCount = listOfPigs.Count;
        listOfPigs.RemoveAt(0);

        var searchPigByIndex = listOfPigs.Get(0);

        // Assert
        Assert.Equal(startCount - 1, listOfPigs.Count);
    }

    [Fact]
    public void Pig_Remove_Test()
    {
        // Arrange
        var listOfPigs = FillListOfPigs();
        var toRemove = listOfPigs.Get(1);

        // Act
        listOfPigs.Remove(toRemove);

        // Assert
        Assert.Equal(-1, listOfPigs.IndexOf(toRemove));
    }

    [Fact]
    public void Pig_IndexOf_Test()
    {
        // Arrange
        var listOfPigs = FillListOfPigs();
        var pig0 = listOfPigs.Get(0);

        var result = listOfPigs.IndexOf(pig0);

        // Assert
        Assert.Equal(0, result);
    }

    [Theory]
    [InlineData("DL6538", true)]
    [InlineData("DL6544", true)]
    [InlineData("DL6565", true)]
    [InlineData("DL0001", false)]
    public void Pig_Contains_Test(string tattooNumber, bool expected)
    {
        // Arrange
        var listOfPigs = FillListOfPigs();

        // Act
        Pig pig = new Pig(tattooNumber, new int[] { 1 });

        // Assert
        Assert.Equal(expected, listOfPigs.Contains(pig));
    }

